Art. 34. A União não intervirá nos Estados nem no Distrito Federal, exceto para:

IV - garantir o livre exercício de qualquer dos Poderes nas unidades da Federação;

VII - assegurar a observância dos seguintes princípios constitucionais:
a) forma republicana, sistema representativo e regime democrático;





Lembrando, o que está em pauta e o nosso direito de expressão, e sem falar na ordem faladas diretamente do Xandão sem respeitar as outras instituições, onde ele legislou, ditou, julgou e estabeleceu o que deveria ser feito ou não, sendo que ele não tem autoridade para isso, sem respeitar as instituições.

